    getPuzzlesCountForId(id) {
        const info = this.getPuzzleInfoById(id);
        const size = GameData.getPuzzleSizePerLevel(info.level);
        let count = 0;
        for (let i = 0; i < size * size; i++) {
            if ((info.pieces & (1 << i)) !== 0)
                count++;
        }
        return count;
    }

